import React from "react";

export default function SearchBarOptions() {
  const handleClick = () => {
    const mainCategories = document.querySelector(".main-categories");
    mainCategories.style.zIndex = "2";
  };

  return (
    <div className="search-filters">
      <h2>Filters</h2>
      <div className="category">
        <p>Category</p>
        <div className="category-box" onClick={handleClick}>
          <p>Choose</p>
          <i class="fa-solid fa-angle-right"></i>
        </div>
      </div>
    </div>
  );
}
